    data: |
      SELECT DISTINCT - 60 AS col0 FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet) AS cor1 WHERE NOT NULL IS NOT NULL;
  - name: tab1
  - name: tab2

outputs:
  - name: q6297.out
    data: |
      -60
